import React, {PropTypes} from 'react';
import KhuNha from './khuNha';
import { suaKhuNha } from '../../../actions/khuNhaActions';

const KNList = ({khunhas}) => {

  suaKhuNha = (khuNhaId, tenKhuNha) => {
    this.props.suaKhuNha(khuNhaId, tenKhuNha)
  }

  return (
        khunhas.map(khunha => 
         <KhuNha 
            tenKhuNha={khunha.tenKhuNha}
            khuNhaId={khunha.khuNhaId}
            suaKhuNha={this.suaKhuNha(khuNhaId, tenKhuNha)} 
          />
        )
  );
};

// KNList.propTypes = {
